import React from "react";

export default (props) => {
    return (
        <tbody>

        {/*<tbody>*/}
        {/*{ props.data.map(item =>(*/}
        {/*    <tr key={item.id}>*/}
        {/*        <td>{item.id}</td>*/}
        {/*        <td>{item.firstName}</td>*/}
        {/*        <td>{item.lastName}</td>*/}
        {/*        <td>{item.email}</td>*/}
        {/*        <td>{item.phone}</td>*/}
        {/*    </tr>*/}
        {/*))}*/}
        {/*</tbody>*/}
        {props.rows.forEach((item, index) =>
            <tr key={index}>
                <td>{item.fio}</td>
                <td>{item.position}</td>
                <td>{item.tabNumber}</td>
                <td>{item.tabNumber}</td>
                <td>{item.tabNumber}</td>
                <td>{item.tabNumber}</td>
                <td>{item.tabNumber}</td>
                <td>{item.tabNumber}</td>
            </tr>
        )}
        </tbody>
    )
}
